    <script>
        $(document).ready(function() {
            $('#prevstep').click(function() {
                $("#step1").show();
                $("#step2").hide();
            });
            $('#riderprevstep').click(function() {
                $("#step1").show();
                $("#riderregister").hide();
            });
            $('#nextstep').click(function() {
                var usertype = $("input[name=usertype]:checked").val();
                if (usertype == 1) {

                    $("#step1").hide();
                    $("#step2").show();
                } else if (usertype == 0) {
                    setTimeout(function() {
                        window.location.href = "<?= KITCHEN_URL ?>register";
                    }, 1000);
                } else if (usertype == 2) {

                    $("#riderregister").show();
                    $("#step1").hide();
                }
            });
        });

        function register() {

            var usertype = $("input[name=usertype]:checked").val();
            var fullname = $("#fullname").val().trim();
            var mobilenumber = $("#mobilenumber").val().trim();
            var email = $("#email").val();
            var password = $("#password").val();
            var isagree = $("#ByContinuingYou").is(":checked");

            var isvalid = 1;
            if (fullname == '') {
                toastr.error('Please enter full name !');
                isvalid = 0;
            }
            if (mobilenumber == '') {
                toastr.error('Please enter mobile number !');
                isvalid = 0;
            } else if (mobilenumber.length != 10) {
                toastr.error('Mobile number required 10 digits !');
                isvalid = 0;
            }
            if (email == '') {
                toastr.error('Please enter email !');
                isvalid = 0;
            } else if (!checkEmail(email)) {
                toastr.error('Please enter valid email address !');
                isvalid = 0;
            }
            if (password == '') {
                toastr.error('Please enter password !');
                isvalid = 0;
            } else if (password.length < 6) {
                toastr.error('Password require minimum 6 characters !');
                isvalid = 0;
            }
            if (!isagree) {
                toastr.error('Please tick the checkbox for you are agree to our terms of service & privacy policy !');
                isvalid = 0;
            }

            if (isvalid == 1) {

                $.ajax({
                    url: SITE_URL + "register/new-register",
                    type: 'POST',
                    data: {
                        usertype: usertype,
                        fullname: fullname,
                        mobilenumber: mobilenumber,
                        email: email,
                        password: password,
                        isagree: isagree
                    },
                    success: function(response) {
                        if (response == 1) {
                            toastr.success('You have been registered successfully.');
                            setTimeout(function() {
                                window.location.href = SITE_URL;
                                $("#step1,#step2").hide();
                                $("#step3").show();
                            }, 2000);
                        } else if (response == 2) {
                            toastr.error('Mobile number already register !');
                        } else if (response == 3) {
                            toastr.error('Email already register !');
                        } else if (response == 0) {
                            toastr.error('Register detail not submit !');
                        }
                    },
                });

            }
        }

        function riderregister() {

            var usertype = 2;
            var fullname = $("#riderfullname").val().trim();
            var mobilenumber = $("#ridermobilenumber").val().trim();
            var email = $("#rideremail").val().trim();
            var city = $("#ridercity").val().trim();
            var licencefile = $("#licencefile").val();
            var rcbookfile = $("#rcbookfile").val();
            var passportfile = $("#passportfile").val();
            var idprooffile = $("#idprooffile").val();

            var isvalid = 1;
            if (fullname == '') {
                toastr.error('Please enter full name !');
                isvalid = 0;
            }
            if (mobilenumber == '') {
                toastr.error('Please enter contact number !');
                isvalid = 0;
            } else if (mobilenumber.length != 10) {
                toastr.error('Contact number required 10 digits !');
                isvalid = 0;
            }
            if (email == '') {
                toastr.error('Please enter email !');
                isvalid = 0;
            } else if (!checkEmail(email)) {
                toastr.error('Please enter valid email address !');
                isvalid = 0;
            }
            if (city == 0) {
                toastr.error('Please select city !');
                isvalid = 0;
            }
            if (licencefile == '' && $("#isvalidlicencefile").val() == 0) {
                toastr.error('Please upload licence !');
                isvalid = 0;
            } else if (licencefile != '' && $("#isvalidlicencefile").val() == 0) {
                toastr.error('Accept only image or pdf file in licence !');
                isvalid = 0;
            }
            if (rcbookfile == '' && $("#isvalidrcbookfile").val() == 0) {
                toastr.error('Please upload RC book !');
                isvalid = 0;
            } else if (rcbookfile != '' && $("#isvalidrcbookfile").val() == 0) {
                toastr.error('Accept only image or pdf file in RC book !');
                isvalid = 0;
            }
            if (passportfile == '' && $("#isvalidpassportfile").val() == 0) {
                toastr.error('Please upload passport !');
                isvalid = 0;
            } else if (passportfile != '' && $("#isvalidpassportfile").val() == 0) {
                toastr.error('Accept only image or pdf file in passport !');
                isvalid = 0;
            }
            if (idprooffile == '' && $("#isvalididprooffile").val() == 0) {
                toastr.error('Please upload ID proof !');
                isvalid = 0;
            } else if (idprooffile != '' && $("#isvalididprooffile").val() == 0) {
                toastr.error('Accept only image or pdf file in ID proof !');
                isvalid = 0;
            }

            if (isvalid == 1) {

                var formData = new FormData($('#riderregisterform')[0]);
                $.ajax({
                    url: SITE_URL + "register/new-rider-register",
                    type: 'POST',
                    data: formData,
                    success: function(response) {
                        if (response == 1) {
                            toastr.success('You have been registered successfully.');
                            setTimeout(function() {
                                window.location.href = SITE_URL;
                            }, 2000);
                        } else if (response == 2) {
                            toastr.error('Email already register !');
                        } else if (response == 3) {
                            toastr.error('Mobile number already register !');
                        } else if (response == 0) {
                            toastr.error('Register detail not submit !');
                        }
                    },
                    cache: false,
                    contentType: false,
                    processData: false
                });

            }
        }

        function checkfile(obj, elementid) {
            var val = obj.val();
            var filename = obj.val().replace(/C:\\fakepath\\/i, '');
            var filesize = obj[0].files[0].size;

            switch (val.substring(val.lastIndexOf('.') + 1).toLowerCase()) {
                case 'jpg':
                case 'jpeg':
                case 'png':
                case 'gif':
                case 'pdf':


                    $("#isvalid" + elementid).val(1);
                    break;
                default:
                    $("#isvalid" + elementid).val(0);
                    toastr.error('Accept only image or pdf file !');
                    break;
            }
        }
    </script>
